import FullGenreList from '../Components/shared/FullGenreList';
import ListNavigator from '../Components/shared/ListNavigator';

const AllGenres = () => {
  return (
    <div>
      <ListNavigator current='All Genres' previous={['dashboard']}/>
      <FullGenreList /> 
    </div>
  )
}

export default AllGenres
